3	Справочник по Java Collections Framework	<p><p><h4>Интерфейс Map [<a href="http://docs.oracle.com/javase/8/docs/api/java/util/Map.html">doc</a>]</h4><br/>\n\n<img src="https://habrastorage.org/files/40a/eca/09a/40aeca09ac1c4cc7bdbd475a3c12fd95.png"/><br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/Hashtable.html">Hashtable</a></b> — реализация такой\nструктуры данных, как хэш-таблица. Она не позволяет использовать <code>null</code> в качестве значения или ключа. Эта\nколлекция была реализована раньше, чем Java Collection Framework, но в последствии была включена в его состав. Как и\nдругие коллекции из Java 1.0, <code>Hashtable</code> является синхронизированной (почти все методы помечены как <code>synchronized</code>).\nИз-за этой особенности у неё имеются существенные проблемы с производительностью и, начиная с Java 1.2, в большинстве\nслучаев рекомендуется использовать другие реализации интерфейса <code>Map</code> ввиду отсутствия у них\nсинхронизации.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/HashMap.html">HashMap</a></b> — коллекция является\nальтернативой <code>Hashtable</code>. Двумя основными отличиями от <code>Hashtable</code> являются то, что\n<code>HashMap</code> не синхронизирована и <code>HashMap</code> позволяет использовать <code>null</code> как в качестве\nключа, так и значения. Так же как и <code>Hashtable</code>, данная коллекция не является упорядоченной: порядок хранения\nэлементов зависит от хэш-функции. Добавление элемента выполняется за константное время O(1), но время удаления,\nполучения зависит от распределения хэш-функции. В идеале является константным, но может быть и линейным O(n). Более\nподробную информацию о <code>HashMap</code> можно почитать <a href="http://habrahabr.ru/post/128017/">здесь</a>\n(актуально для Java &lt; 8). <br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/LinkedHashMap.html">LinkedHashMap</a></b> — это\nупорядоченная реализация хэш-таблицы. Здесь, в отличии от <code>HashMap</code>, порядок итерирования равен порядку\nдобавления элементов. Данная особенность достигается благодаря двунаправленным связям между элементами (аналогично\n<code>LinkedList</code>). Но это преимущество имеет также и недостаток — увеличение памяти, которое занимет коллекция.\nБолее подробная информация изложена в этой <a href="http://habrahabr.ru/post/129037/">статье</a>.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/TreeMap.html">TreeMap</a></b> — реализация\n<code>Map</code> основанная на красно-чёрных деревьях. Как и <code>LinkedHashMap</code> является упорядоченной.\nПо-умолчанию, коллекция сортируется по ключам с использованием принципа &quot;<a\n        href="http://docs.oracle.com/javase/8/docs/api/java/lang/Comparable.html">natural ordering</a>&quot;, но это\nповедение может быть настроено под конкретную задачу при помощи объекта <code>Comparator</code>, которые указывается в\nкачестве параметра при создании объекта <code>TreeMap</code>.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/WeakHashMap.html">WeakHashMap</a></b> — реализация\nхэш-таблицы, которая организована с использованием <a\n        href="http://docs.oracle.com/javase/8/docs/api/java/lang/ref/WeakReference.html">weak references</a>. Другими\nсловами, Garbage Collector автоматически удалит элемент из коллекции при следующей сборке мусора, если на ключ этого\nэлеметна нет жёстких ссылок. <br/>\n<br/>\n<h4>Интерфейс List [<a href="http://docs.oracle.com/javase/8/docs/api/java/util/List.html">doc</a>]</h4><br/>\n<img src="https://habrastorage.org/files/187/da1/649/187da164972c4519b6affbc4a2c6fda1.png"/><br/>\n<br/>\nРеализации этого интерфейса представляют собой упорядоченные коллекции. Кроме того, разработчику предоставляется\nвозможность доступа к элементам коллекции по индексу и по значению (так как реализации позволяют хранить дубликаты,\nрезультатом поиска по значению будет первое найденное вхождение).<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/Vector.html">Vector</a></b> — реализация динамического\nмассива объектов. Позволяет хранить любые данные, включая null в качестве элемента. <code>Vector</code> появился в JDK\nверсии Java 1.0, но как и <code>Hashtable</code>, эту коллекцию не рекомендуется использовать, если не требуется\nдостижения потокобезопасности. Потому как в <code>Vector</code>, в отличии от других реализаций <code>List</code>, все\nоперации с данными являются синхронизированными. В качестве альтернативы часто применяется аналог —\n<code>ArrayList</code>.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/Stack.html">Stack</a></b> — данная коллекция является\nрасширением коллекции <code>Vector</code>. Была добавлена в Java 1.0 как реализация стека LIFO (last-in-first-out).\nЯвляется частично синхронизированной коллекцией (кроме метода добавления <code>push()</code>). После добавления в Java\n1.6 интерфейса <code>Deque</code>, рекомендуется использовать именно реализации этого интерфейса, например <code>ArrayDeque</code>.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/ArrayList.html">ArrayList</a></b> — как и\n<code>Vector </code> является реализацией динамического массива объектов. Позволяет хранить любые данные, включая null в\nкачестве элемента. Как можно догадаться из названия, его реализация основана на обычном массиве. Данную реализацию\nследует применять, если в процессе работы с коллекцией предплагается частое обращение к элементам по индексу. Из-за\nособенностей реализации поиндексное обращение к элементам выполняется за константное время O(1). Но данную коллекцию\nрекомендуется избегать, если требуется частое удаление/добавление элементов в середину коллекции. Подробный анализ и\nописание можно почитать в <a href="http://habrahabr.ru/post/128269/">этом</a> хабратопике.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/LinkedList.html">LinkedList</a></b> — ещё одина\nреализация <code>List</code>. Позволяет хранить любые данные, включая <code>null</code>. Особенностью реализации данной\nколлекции является то, что в её основе лежит двунаправленный связный список (каждый элемент имеет ссылку на предыдущий и\nследующий). Благодаря этому, добавление и удаление из середины, доступ по индексу, значению происходит за линейное время\nO(n), а из начала и конца за константное O(1). Так же, ввиду реализации, данную коллекцию можно использовать как стек\nили очередь. Для этого в ней реализованы соответсвующие методы. На Хабре также есть <a\n        href="http://habrahabr.ru/post/127864/">статья </a>с подробным анализом и описанием этой коллекции.<br/>\n<br/>\n<h4>Интерфейс Set [<a href="http://docs.oracle.com/javase/8/docs/api/java/util/Set.html">doc</a>]</h4><br/>\n<img src="https://habrastorage.org/files/aca/208/428/aca20842816a48628772bd23d2bb0f24.png"/><br/>\n<br/>\nПредставляет собой неупорядоченную коллекцию, которая не может содержать дублирующиеся данные. Является программной\nмоделью математического понятия «множество». <br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/HashSet.html">HashSet</a></b> — реализация интерфейса\n<code>Set</code>, базирующаяся на <code>HashMap</code>. Внутри использует объект HashMap для хранения данных. В качестве\nключа используется добавляемый элемент, а в качестве значения — объект-пустышка (new Object()). Из-за особенностей\nреализации порядок элементов не гарантируется при добавлении.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/LinkedHashSet.html">LinkedHashSet</a></b> — отличается от\n<code>HashSet</code> только тем, что в основе лежит <code>LinkedHashMap</code> вместо <code>HashSet</code>. Благодаря\nэтому отличию порядок элементов при обходе коллекции является идентичным порядку добавления элементов.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/TreeSet.html">TreeSet</a></b> — аналогично другим\nклассам-реализациям интерфейса <code>Set</code> содержит в себе объект <code>NavigableMap</code>, что и обуславливает\nего поведение. Предоставляет возможность управлять порядком элементов в коллекции при помощи объекта\n<code>Comparator</code>, либо сохраняет элементы с использованием &quot;<a\n        href="http://docs.oracle.com/javase/8/docs/api/java/lang/Comparable.html">natural ordering</a>&quot;.<br/>\n<br/>\n<h4>Интерфейс Queue [<a href="http://docs.oracle.com/javase/8/docs/api/java/util/Set.html">doc</a>]</h4><br/>\n<img src="https://habrastorage.org/files/3ee/116/dc0/3ee116dc0d6e4775a72187f551001869.png"/><br/>\n<br/>\nЭтот интерфейс описывает коллекции с предопределённым способом вставки и извлечения элементов, а именно — очереди FIFO\n(first-in-first-out). Помимо методов, определённых в интерфейсе Collection, определяет дополнительные методы для\nизвлечения и добавления элементов в очередь. Большинство реализаций данного интерфейса находится в пакете <code>java.util.concurrent</code>\nи подробно рассматриваются в <a href="http://habrahabr.ru/company/luxoft/blog/157273/">данном</a> обзоре.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/PriorityQueue.html">PriorityQueue</a></b> — является\nединственной прямой реализацией интерфейса <code>Queue</code> (была добавлена, как и интерфейс Queue, в Java 1.5), не\nсчитая класса <code>LinkedList</code>, который так же реализует этот интерфейс, но был реализован намного раньше.\nОсобенностью данной очереди является возможность управления порядком элементов. По-умолчанию, элементы сортируются с\nиспользованием «natural ordering», но это поведение может быть переопределено при помощи объекта <code>Comparator</code>,\nкоторый задаётся при создании очереди. Данная коллекция не поддерживает <code>null</code> в качестве элементов.<br/>\n<br/>\n<b><a href="http://docs.oracle.com/javase/8/docs/api/java/util/ArrayDeque.html">ArrayDeque</a></b> — реализация\nинтерфейса <a href="http://docs.oracle.com/javase/8/docs/api/java/util/Deque.html">Deque</a>, который расширяет\nинтерфейс <code>Queue</code> методами, позволяющими реализовать конструкцию вида LIFO (last-in-first-out). Интерфейс\n<code>Deque </code>и реализация <code>ArrayDeque </code>были добавлены в Java 1.6. Эта коллекция представляет собой\nреализацию с использованием массивов, подобно <code>ArrayList</code>, но не позволяет обращаться к элементам по индексу\nи хранение <code>null</code>. Как заявлено в документации, коллекция работает быстрее чем <code>Stack</code>, если\nиспользуется как LIFO коллекция, а также быстрее чем LinkedList, если используется как FIFO.<br/>\n<br/>\n<h4>Заключение</h4><br/>\nJava Collections Framework содержит большое количество различных структур данных, доступных в JDK «из коробки», которые\nв большинстве случаев покрывают все потребности при реализации логики приложения. Сравнение временных характеристик\nосновных коллекций, которые зачастую используются в разработке приложений приведено в таблице:<br/>\n<br/>\n<img src="https://habrastorage.org/files/364/d7e/419/364d7e41907e453b8e60128cdac459dc.png"/><br/>\n<br/>\nПри необходимости, разработчик может создать собственную реализацию, расширив или переопределив существующую логику,\nлибо создав свою собственную реализацию подходящего интерфейса с нуля. Также существует некоторое количество готовых\nрешений, которые являются альтернативой или дополнением к Java Collections Framework. Наиболее популярными являются <a\n        href="https://code.google.com/p/guava-libraries/">Google Guava</a> и <a\n        href="http://commons.apache.org/proper/commons-collections/">Commons Collections</a>.<br/>\n<br/>\nВ дополнение, хотелось бы указать в качестве дополнительного материала, <a\n        href="http://habrahabr.ru/company/luxoft/blog/157273/">ссылку</a> на обзор пакета\n<code>java.util.concurrent</code>. Который является отличным дополнением к изложенному материалу.</p>\n	\\	2020-07-29 14:01:17.502
4	Java Collections Framework	<p>Коллекциями/контейнерами в Java принято называть классы, основная цель которых – хранить набор других элементов. <br><br> Коллекции могут хранить любые ссылочные типы данных. <br><br> List — это упорядоченный список. Объекты хранятся в порядке их добавления в список. Доступ к элементам списка осуществляется по индексу. <br><br> Set — множество неповторяющихся объектов. В коллекции этого типа разрешено наличие только одной ссылки типа null. <br><br> Queue — коллекция, предназначенная для хранения элементов в порядке, нужном для их обработки. В дополнение к базовым операциям интерфейса Collection, очередь предоставляет дополнительные операции вставки, получения и контроля. <br> Очереди обычно, но не обязательно, упорядочивают элементы в FIFO (first-in-first-out, «первым вошел — первым вышел») порядке. <br> Метод offer() вставляет элемент в очередь, если это не удалось — возвращает false. Этот метод отличается от метода add() интерфейса Collection тем, что метод add() может неудачно добавить элемент только с использованием unchecked исключения. <br> Методы remove() и poll() удаляют верхушку очереди и возвращают ее. Какой элемент будет удален (первый или последний) зависит от реализации очереди. <br>Методы remove() и poll() отличаются лишь поведением, когда очередь пустая: метод remove() генерирует исключение, а метод poll() возвращает null. <br> Методы element() и peek() возвращают (но не удаляют) верхушку очереди. <br> java.util.Queue<E> реализует FIFO–буфер. Позволяет добавлять и получать объекты. При этом объекты могут быть получены в том порядке, в котором они были добавлены. Реализации: java.util.ArrayDeque<E>, java.util.LinkedList<E>.<br> java.util.Deque<E> наследует java.util.Queue<E>. Двунаправленная очередь. Позволяет добавлять и удалять объекты с двух концов. Так же может быть использован в качестве стека. <br> Реализации: java.util.ArrayDeque<E>, java.util.LinkedList<E>.<br><br> Интерфейс java.util.Map<K,V> используется для отображения каждого элемента из одного множества объектов (ключей) на другое (значений). При этом, каждому элементу из множества ключей ставится в соответствие множество значений. В то же время одному элементу из множества значений может соответствовать 1, 2 и более элементов из множества ключей. Интерфейс java.util.Map<K,V>описывает функциональность ассоциативных массивов. <br> Реализации: java.util.HashMap<K,V>, java.util.LinkedHashMap<K,V>, java.util.TreeMap<K,V>, java.util.WeakHashMap<K,V>.<br> java.util.SortedMap<K,V> наследует java.util.Map<K,V>. Реализации этого интерфейса обеспечивают хранение элементов множества ключей в порядке возрастания (см. java.util.SortedSet). Реализации: java.util.TreeMap<K,V>.<br><br> ArrayList реализован внутри в виде обычного массива. Поэтому при вставке элемента в середину, приходится сначала сдвигать на один все элементы после него, а уже затем в освободившееся место вставлять новый элемент. Зато в нем быстро реализованы взятие и изменение элемента – операции get, set, так как в них мы просто обращаемся к соответствующему элементу массива. <br><br> LinkedList реализован внутри по-другому. Он реализован в виде связного списка: набора отдельных элементов, каждый из которых хранит ссылку на следующий и предыдущий элементы. Чтобы вставить элемент в середину такого списка, достаточно поменять ссылки его будущих соседей. А вот чтобы получить элемент с номером 130, нужно пройтись последовательно по всем объектам от 0 до 130.Другими словами операции set и get тут реализованы очень медленно. <br><br> Если необходимо вставлять (или удалять) в середину коллекции много элементов, то лучше использовать LinkedList. Во всех остальных случаях – ArrayList. <br><br>  LinkedList требует больше памяти для хранения такого же количества элементов, потому что кроме самого элемента хранятся еще указатели на следующий и предыдущий элементы списка, тогда как в ArrayList элементы просто идут по порядку<br><br> Название Hash… происходит от понятия хэш-функция. Хэш-функция — это функция, сужающая множество значений объекта до некоторого подмножества целых чисел. <br>Класс Object имеет метод hashCode(), который используется классом HashSet для эффективного размещения объектов, заносимых в коллекцию. В классах объектов, заносимых в HashSet, этот метод должен быть переопределен (override). <br> HashSet реализован на основе хеш-таблицы, а TreeSet — на основе бинарного дерева. <br> HashSet гораздо быстрее чем TreeSet (константное время против логарифмического для большинства операций, таких как add, remove, contains), но TreeSet гарантирует упорядоченность объектов. Оба не синхронизированы. <br><br> HashSet<br> •\tпредоставляет константное время для add(), remove(), contains() и size()<br> •\tпорядок элементов в контейнере может меняться<br> •\tпроизводительность итерации по контейнеру зависит от емкости и «коэффициента загрузки» (рекомендуется оставлять load factor значением по умолчанию равным 0.75, что является хорошим компромиссом между временем доступа и объемом хранимых данных) <br><br> TreeSet<br> •\tвремя для базовых операций add(), remove(), contains() — log(n) <br> •\tгарантирует порядок элементов<br> •\tне предоставляет каких-либо параметров для настройки производительности<br> •\tпредоставляет дополнительные методы для упорядоченного списка: first(), last(), headSet(), tailSet() и т.д. <br><br> •\tTreeMap реализован на красно-черном дереве, время добавления/поиска/удаления элемента — O(log N), где N — число элементов в TreeMap на данный момент. <br> •\tУ HashMap время доступа к отдельному элементу — O(1) при условии, что хэш-функция (Object.hashCode()) определена нормально (что является правдой в случае Integer). <br> •\tОбщая рекомендация — если не нужна упорядоченность, использовать HashMap. Исключение — ситуация с вещественными числами, которые в качестве ключей почти всегда очень плохи. Для них нужно использовать TreeMap, предварительно поставив ему компаратор, который сравнивает вещественные числа так, как это нужно в данной задаче. Например, для обычных геометрических задач два вещественных числа могут считаться равными, если отличаются не более, чем на 1e-9. <br><br></p>	\\	2020-07-29 14:01:45.52
